import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    footerBlock: {
        backgroundColor: '#fff',
        position: 'absolute',
        width: '100%',
        boxShadow: '0px 3px 20px 0px'
    },
    footerContainer: {
        width: '100%',
        height: '100%',
        color: '#5656ef',
        padding: '35px 0',
        fontSize: 20
    },
    logoImg: {
        width: 167,
        height: '100%'
    }
})

export default useStyles
